import React from 'react';
import './Home.css'; // Make sure you have a corresponding CSS file
import image1 from '../assets/text.png';
import image2 from '../assets/image 7.png';
const Home = () => {
  return (
    <div>
      <header className="header">
        <div className = "front">
          <div className = "leftcontainer">
            <div className= "top">
              <div className = "circlecont">
                <div className="circle1"></div>
                <div className="circle2"></div>
                <div className="circle3"></div>
              </div> 
            </div>
            <div className = "topbottom"></div>
            <img src={image1} alt="text" className="image1" />
          </div>
          <div className = "right container" >
            <img src={image2} alt="rightpic" className="image2" />
          </div>  
      </div>



      </header>
      <section className="content">
        <p>This is the rest of your website content.</p>
        <p>It will have a white background as you scroll down.</p>
      </section>
    </div>

  );
};

export default Home;
